PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE statistic (
    hdf5_index	INTEGER PRIMARY KEY AUTOINCREMENT,
    external_id	VARCHAR(100)
  );
CREATE TABLE snp (
    hdf5_index	INTEGER PRIMARY KEY AUTOINCREMENT,
    external_id	VARCHAR(100)
  );
CREATE TABLE gene (
    hdf5_index	INTEGER PRIMARY KEY AUTOINCREMENT,
    external_id	VARCHAR(100)
  );
CREATE TABLE tissue (
    hdf5_index	INTEGER PRIMARY KEY AUTOINCREMENT,
    external_id	VARCHAR(100)
  );
DELETE FROM sqlite_sequence;
CREATE INDEX idx_gene ON gene (external_id);
CREATE INDEX idx_snp ON snp (external_id);
CREATE INDEX idx_statistic ON statistic (external_id);
CREATE INDEX idx_tissue ON tissue (external_id);
COMMIT;
